package com.ft.membership.spoorclient;import javax.servlet.http.HttpServletRequest;import java.util.function.Function;public class DefaultSpoorParametersFactory extends SpoorParametersFactory<SpoorParameters>{    public DefaultSpoorParametersFactory(String apiKey, String appRootUrl, Function<HttpServletRequest, String> productFactory) {        super(apiKey, appRootUrl, productFactory);    }    public DefaultSpoorParametersFactory(String apiKey, String appRootUrl, String product) {        super(apiKey, appRootUrl, product);    }    @Override    protected SpoorParameters buildSpoorParameters(SpoorSystem trackingSystem, SpoorDevice trackingDevice, SpoorContext trackingContext) {        return new SpoorParameters(trackingSystem, trackingContext, trackingDevice, "page", "view");    }}